import React, { useState, useEffect, useRef } from 'react';
import './Chat.css';
import logo from './path/to/hyperledger-logo.png'; // Add the correct path to the logo

function Chat() {
    const [input, setInput] = useState('');
    const [chatHistory, setChatHistory] = useState([]);
    const [isProcessing, setIsProcessing] = useState(false);
    const chatEndRef = useRef(null);

    const handleInputChange = (event) => {
        setInput(event.target.value);
    };

    const handleSend = async () => {
        if (input.trim() === '') return;

        setIsProcessing(true);
        setChatHistory([...chatHistory, { query: input, reply: 'Processing...' }]);

        const response = await fetch('http://localhost:8001/api/chat/', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ message: input }),
        });

        if (response.ok) {
            const data = await response.json();
            setChatHistory((prevHistory) => {
                const newHistory = [...prevHistory];
                newHistory[newHistory.length - 1].reply = data.response;
                return newHistory;
            });
        } else {
            setChatHistory((prevHistory) => {
                const newHistory = [...prevHistory];
                newHistory[newHistory.length - 1].reply = 'Failed to get response';
                return newHistory;
            });
        }

        setInput('');
        setIsProcessing(false);
    };

    const handleKeyPress = (event) => {
        if (event.key === 'Enter') {
            handleSend();
        }
    };

    useEffect(() => {
        chatEndRef.current?.scrollIntoView({ behavior: 'smooth' });
    }, [chatHistory, isProcessing]);

    return (
        <div className="chat-container">
            <div className="sidebar">
                <img src={logo} alt="Hyperledger Logo" className="logo" />
                <div className="sidebar-item">Today</div>
                <div className="sidebar-item">What is Hyperledger?</div>
                <div className="sidebar-item">Setting up Hyperledger Iroha?</div>
                <div className="sidebar-item">What are the current good first issues?</div>
                <div className="sidebar-item">Yesterday</div>
                <div className="sidebar-item">What principle does the Iroha API follow?</div>
                <div className="sidebar-item">How are permissions in Iroha categorized?</div>
                <div className="sidebar-item">What kind of information can be stored?</div>
                <div className="sidebar-item">What is the purpose of a command?</div>
                <div className="sidebar-item">Few Days Back</div>
                <div className="sidebar-item">Give an example of an entity that ...</div>
            </div>
            <div className="chat-section">
                <div className="chat-history">
                    {chatHistory.map((item, index) => (
                        <div key={index} className="chat-message">
                            <div className="user-message"><span className="user-input">{item.query}</span></div>
                            <div className="bot-message">
                                <b className="bot-label">Bot:</b>
                                <span className="bot-response">{item.reply}</span>
                            </div>
                        </div>
                    ))}
                    <div ref={chatEndRef} />
                </div>
                <div className="input-container">
                    <input
                        className="chat-input"
                        value={input}
                        onChange={handleInputChange}
                        onKeyPress={handleKeyPress}
                        placeholder="Type a message..."
                        disabled={isProcessing}
                    />
                    <button className="chat-button" onClick={handleSend} disabled={isProcessing}>
                        <img src="path/to/send-icon.png" alt="Send" className="send-icon" />
                    </button>
                </div>
            </div>
        </div>
    );
}

export default Chat;
